import './App.css';
import searchIcon from "./search.png"


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p className="myLounge-heading">
          myLounge
        </p>
        <p className="myLounge-subtitle">
          Listen. Watch. Relax.
        </p>
        <div className="searchbox">
          <img src={searchIcon} className="searchIcon" alt="appSearchIcon"></img>
          <p className="placeholder-text">Search for Movie, TV Show, Podcast or Music by name...</p>
        </div>
      </header>
      <body className="App-media-options">
        <p>hello</p>
      </body>
    </div>
  );
}

export default App;
